import React, { useState } from 'react';
import styled from 'styled-components';
import glossary from './../glossary';
const StyledSearchBar = styled.input`
	font-size: 1rem;
	padding: 1rem;
	border: #ccc solid 1px;
	border-radius: 5px;
	position: relative;
	width: 100%;
	max-width: 600px;
	margin: 0 auto;
`;

const GlossaryPage = () => {
	const glossaryItem = glossary.map((data) => (
		<div key={data.term}>
			<h1>{data.term}</h1>
			<p>{data.definition}</p>
		</div>
	));
	return (
		<div>
			<h1>glossary</h1>

			{glossaryItem}
		</div>
	);
};

export default GlossaryPage;
